## Decorative transition screens for MACROSS scripts

function transitionSplash([int]$a=0,[int]$s){
    <#
    ||longhelp||

    transitionSplash [-a ART ITEM] [-s NUMBER OF SECONDS TO DISPLAY]

    select one of these numbers to get ascii art:
    
     0 = VF-1S Battroid "Skull Leader" (default)
     1 = VF-19 Gerwalk
     2 = SDF-1
     3 = VF-1J Fighter
     4 = Gubaba
     5 = Lynn Minmay
     6 = Mylene Jenius
     7 = Nekki Basara
     8 = Hikaru Ichijo
     9 = Sheryl Nome
    10 = VF-25 Messiah Fighter
    11 = Konig Monster
    
    Use -s <number of seconds> to clear the screen after that many seconds, otherwise 
    the art will remain for the duration of the next task.

    You can get a slideshow preview of all these images by typing "splash" in the main
    menu.
    
    ||examples||
    Display the VF-25 Messiah onscreen for 2 seconds:
    
        transitionSplash -a 10 -s 2
    
    Do the same without clearing the screen:
    
        transitionSplash 10 
        
    
    #>
    $b = @(
        '',
        '',
        '',
        '',
        '',
        '',
        '',
        '',
        '',
        '',
        '',
        ''
    )
    $c = @(
        "                                    DYRL VF-1S 'SKULL LEADER'",
        "                                           MACROSS 7 VF-19 'FIRE'",
        "                                           SDF MACROSS",
        "                                VF-1S VALKRYIE FIGHTER (MACROSS)",
        "                                           Gubaba (MACROSS 7)",
        "                      LYNN MINMAY (MACROSS DYRL)",
        "                        MYLENE JENIUS (MACROSS 7)",
        "                         NEKKI BASARA (MACROSS 7)",
        "                                HIKARU ICHIJO (MACROSS)",
        "                                 Sheryl Nome (MACROSS FRONTIER)",
        "                                  VF-25 Messiah (MACROSS FRONTIER)",
        "               VB-6  KONIG MONSTER (MACROSS VFX-2, MACROSS FRONTIER)"
    )

    cls

    getThis $b[$a]
    Write-Host -f YELLOW "$vf19_READ`n"
    Write-Host -f YELLOW $c[$a]
    if( [int]$s ){ slp $s; cls }
}
